INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0, 7001, 1, 0.0, 7, 1, -363.0, 1, "2030/12/17 14:59:59", "キャル", 0, 106001, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0, 7002, 1, 0.0, 7, 1, -363.0, 1, "2030/12/17 14:59:59", "コッコロ", 0, 105901, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0, 7003, 1, 0.0, 7, 1, -363.0, 1, "2030/12/17 14:59:59", "ペコリーヌ", 0, 105801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0, 10001, 1, 0.0, 10, 1, -363.0, 1, "2030/12/17 14:59:59", "ペコリーヌ", 0, 105801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0, 10002, 1, 0.0, 10, 1, -363.0, 1, "2030/12/17 14:59:59", "キャル", 0, 106001, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0, 10003, 1, 0.0, 10, 1, -363.0, 1, "2030/12/17 14:59:59", "コッコロ", 0, 105901, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 2104010, 10004, 2, 0.0, 10, 1, -363.0, 1, "2030/12/17 14:59:59", "シェフィ", 0, 106401, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0, 12001, 1, 0.0, 12, 1, -416.5, 1, "2030/12/17 14:59:59", "ペコリーヌ", 0, 105801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0, 13001, 1, 0.0, 13, 1, -363.0, 1, "2030/12/17 14:59:59", "キャル", 0, 106001, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0, 13002, 1, 0.0, 13, 1, -363.0, 1, "2030/12/17 14:59:59", "コッコロ", 0, 105901, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 2104010, 13003, 2, 0.0, 13, 1, -363.0, 1, "2030/12/17 14:59:59", "シェフィ", 0, 106401, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0, 13004, 1, 0.0, 13, 1, -363.0, 1, "2030/12/17 14:59:59", "ペコリーヌ", 0, 105801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0, 14001, 1, 0.0, 14, 1, -363.0, 1, "2030/12/17 14:59:59", "コッコロ", 0, 105901, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 2104010, 14002, 2, 0.0, 14, 1, -363.0, 1, "2030/12/17 14:59:59", "シェフィ", 0, 106401, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0, 14003, 1, 0.0, 14, 1, -363.0, 1, "2030/12/17 14:59:59", "ペコリーヌ", 0, 105801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0, 14004, 1, 0.0, 14, 1, -363.0, 1, "2030/12/17 14:59:59", "キャル", 0, 106001, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0, 15001, 1, 0.0, 15, 1, -470.0, 1, "2030/12/17 14:59:59", "コッコロ", 0, 105901, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 2104010, 16001, 2, 0.0, 16, 1, -363.0, 1, "2030/12/17 14:59:59", "シェフィ", 0, 106401, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0, 16002, 1, 0.0, 16, 1, -363.0, 1, "2030/12/17 14:59:59", "ペコリーヌ", 0, 105801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0, 16003, 1, 0.0, 16, 1, -363.0, 1, "2030/12/17 14:59:59", "キャル", 0, 106001, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0, 16004, 1, 0.0, 16, 1, -363.0, 1, "2030/12/17 14:59:59", "コッコロ", 0, 105901, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0, 17002, 1, 0.0, 17, 1, -363.0, 1, "2030/12/17 14:59:59", "コッコロ", 0, 105901, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0, 17004, 1, 0.0, 25, 1, -363.0, 1, "2030/12/17 14:59:59", "キャル", 0, 106001, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0, 17005, 1, 0.0, 25, 1, -363.0, 1, "2030/12/17 14:59:59", "コッコロ", 0, 105901, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 2104010, 17006, 2, 0.0, 25, 1, -363.0, 1, "2030/12/17 14:59:59", "シェフィ", 0, 106401, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0, 17007, 1, 0.0, 25, 1, -363.0, 1, "2030/12/17 14:59:59", "ペコリーヌ", 0, 105801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0, 18001, 1, 0.0, 18, 1, -363.0, 1, "2030/12/17 14:59:59", "カリン", 0, 190801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 0, 18002, 1, 0.0, 18, 1, -363.0, 2, "2030/12/17 14:59:59", "カリン", 0, 190801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0, 19001, 1, 0.0, 19, 1, -470.0, 3, "2030/12/17 14:59:59", "カリン", 0, 190801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0, 19002, 1, 0.0, 19, 1, -470.0, 4, "2030/12/17 14:59:59", "カリン", 0, 190801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0, 20001, 1, 0.0, 20, 1, -470.0, 5, "2030/12/17 14:59:59", "カリン", 0, 190801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0, 20002, 1, 0.0, 20, 1, -470.0, 6, "2030/12/17 14:59:59", "カリン", 0, 190801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0, 21001, 1, 0.0, 21, 1, -363.0, 1, "2030/12/17 14:59:59", "キャル", 0, 106001, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0, 21002, 1, 0.0, 21, 1, -363.0, 1, "2030/12/17 14:59:59", "コッコロ", 0, 105901, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 2104010, 21003, 2, 0.0, 21, 1, -363.0, 1, "2030/12/17 14:59:59", "シェフィ", 0, 106401, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0, 21004, 1, 0.0, 21, 1, -363.0, 1, "2030/12/17 14:59:59", "ペコリーヌ", 0, 105801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0, 22001, 1, 0.0, 22, 1, -430.0, 1, "2030/12/17 14:59:59", "カリン", 0, 190801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0, 22002, 1, 0.0, 22, 1, -430.0, 2, "2030/12/17 14:59:59", "カリン", 0, 190801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0, 23001, 1, 0.0, 23, 1, -430.0, 3, "2030/12/17 14:59:59", "カリン", 0, 190801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0, 23002, 1, 0.0, 23, 1, -430.0, 4, "2030/12/17 14:59:59", "カリン", 0, 190801, "2015/12/17 15:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (8.0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 0, 24001, 1, 4.08, 24, 2, -385.0, 1, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 10011, 109001, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (8.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 0, 24002, 1, 5.0, 24, 2, -385.0, 2, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 10011, 109001, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (8.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 0, 24003, 1, 10.11, 24, 2, -385.0, 3, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 10011, 109001, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (8.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 0, 24004, 1, 4.0, 24, 2, -385.0, 4, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 10011, 109001, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (8.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 0, 24005, 1, 6.0, 24, 2, -385.0, 5, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 10011, 109001, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0, 24006, 1, 0.0, 24, 1, 0.0, 6, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 10011, 109002, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0, 24007, 1, 0.0, 24, 1, 0.0, 7, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 10011, 109002, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0, 24008, 1, 0.0, 24, 1, 0.0, 8, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 10011, 109002, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0, 24009, 1, 0.0, 24, 1, 0.0, 9, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 10011, 109002, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0, 24010, 1, 0.0, 24, 1, 0.0, 10, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 10011, 109002, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (8.0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 0, 24011, 1, 2.12, 24, 2, -385.0, 1, "2030/12/17 14:59:59", "シズル（バレンタイン）", 10011, 109101, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (8.0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 0, 24012, 5, 4.19, 24, 2, -385.0, 2, "2030/12/17 14:59:59", "シズル（バレンタイン）", 10011, 109101, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (8.0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 0, 24013, 2, 2.3, 24, 4, -385.0, 3, "2030/12/17 14:59:59", "シズル（バレンタイン）", 10011, 109101, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0, 24014, 1, 0.0, 24, 1, 0.0, 4, "2030/12/17 14:59:59", "シズル（バレンタイン）", 10011, 109102, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (8.0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 0, 24015, 5, 5.23, 24, 2, -385.0, 5, "2030/12/17 14:59:59", "シズル（バレンタイン）", 10011, 109101, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0, 24016, 1, 0.0, 24, 1, 0.0, 6, "2030/12/17 14:59:59", "シズル（バレンタイン）", 10011, 109102, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (8.0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 0, 24017, 1, 5.01, 24, 2, -385.0, 7, "2030/12/17 14:59:59", "シズル（バレンタイン）", 10011, 109101, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0, 24018, 1, 0.0, 24, 1, 0.0, 8, "2030/12/17 14:59:59", "シズル（バレンタイン）", 10011, 109102, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0, 24019, 1, 0.0, 24, 1, 0.0, 9, "2030/12/17 14:59:59", "シズル（バレンタイン）", 10011, 109102, "2019/01/31 12:00:00");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0, 24020, 1, 0.0, 24, 1, 0.0, 10, "2030/12/17 14:59:59", "シズル（バレンタイン）", 10011, 109102, "2019/01/31 12:00:00");
